import {Component} from 'react'
import Header from '../Header'

class Home extends Component {
  componentDidMount() {
    this.getTrendingMovies()
  }

  getTrendingMovies = async () => {
    const url =
      'https://api.themoviedb.org/3/trending/all/week?api_key=970d698cc21f18d0759bec348ed6e217'

    const options = {
      method: 'GET',
    }

    const response = await fetch(url, options)
    const data = await response.json()

    console.log(data)
  }

  render() {
    return (
      <>
        <Header />
        <h1>Home</h1>
      </>
    )
  }
}

export default Home
